import React from 'react';
import './toolbar.scss';

const Toolbar = (props) => {
    return (
        <div className="toolbar">
            <input type="checkbox" className="toolbar-checkbox" id ="toolbar"></input>
            <label for="toolbar" className="toolbar-button">
                <span className="toolbar-button-icon">&nbsp;</span>
            </label>
        </div>
    );
}

export default Toolbar;
